class Solution {
    public boolean checkInclusion(String s1, String s2) {
        int[] debugS1 = new int[30];
        int[] debugS2 = new int[30];

        int hash = 0;
        for (int i = 0; i< s1.length(); i++) {
            debugS1[s1.charAt(i) - 'a']++;
            hash += charHashCode(s1.charAt(i));
            System.out.println("s1 c = " + s1.charAt(i) + " hash=" + charHashCode(s1.charAt(i)) + " hashsum=" + hash);
        }
        int subHash = 0;
        for (int i = 0; i< s1.length(); i++) {
            debugS2[s2.charAt(i)- 'a']++;
            subHash += charHashCode(s2.charAt(i));
            System.out.println("s2 c = " + s2.charAt(i) + " hash=" + charHashCode(s2.charAt(i)) + " hashsum=" + subHash);
        }
        System.out.println(Arrays.toString(debugS1));
        System.out.println( Arrays.toString(debugS2));
        for (int i=s1.length(); i< s2.length(); i++){
            debugS2[s2.charAt(i)- 'a']++;
            debugS2[s2.charAt(i - s1.length())- 'a']--;

            subHash += charHashCode(s2.charAt(i)) - charHashCode(s2.charAt(i - s1.length()));
            int zhash = charHashCode('z');
            if (/*debugS2[0] == 0 && debugS2[7] == 0 && debugS2[24] == 0 */
                    /*(subHash > hash && subHash - hash <= zhash) || (hash > subHash && hash - subHash <= zhash)*/
                debugS2['o' - 'a'] >= 5 && debugS2['p' - 'a'] >= 3 && debugS2['u' - 'a'] >= 4 ) {
                System.out.println("s2 add c = " + s2.charAt(i) + " hash=" + charHashCode(s2.charAt(i)) + " hashsum="
                        + subHash);
                System.out.println("i = " + i + " " + Arrays.toString(debugS1));
                System.out.println("i = " + i + " " + Arrays.toString(debugS2));
            }

            if (subHash == hash) {
                System.out.println("i = " + i + "find " );
                //return true;
            }
        }
        return false;
    }

    private int charHashCode (char c) {
       // return (c - 'a') * (c - 'a') + c -'a';
        return c * ( c - 'a') + c;
    }


    class Solution2 {
        public boolean checkInclusion(String s1, String s2) {
            if (s1.length() > s2.length()) {
                return false;
            }
            int hash = 0;
            for (int i = 0; i< s1.length(); i++) {
                hash += charHashCode(s1.charAt(i));
            }
            int subHash = 0;
            for (int i = 0; i< s1.length(); i++) {
                subHash += charHashCode(s2.charAt(i));
            }
            if (subHash == hash) {
                return true;
            }
            for (int i=s1.length(); i< s2.length(); i++){
                subHash += charHashCode(s2.charAt(i)) - charHashCode(s2.charAt(i - s1.length()));
                if (subHash == hash) {
                    return true;
                }
            }
            return false;
        }

        private int charHashCode (char c) {
            return  c * ( c - 'a') + c;
        }
    }

    class Solution3 {
        public boolean checkInclusion(String s1, String s2) {
            if (s1.length() > s2.length()) {
                return false;
            }
            int [] hash = new int[26];
            for (int i=0;i< s1.length(); i++) {
                hash[s1.charAt(i) - 'a']++;
                hash[s2.charAt(i) - 'a']--;
            }
            int diff = 0;
            for (int i=0; i < 26; i++) {
                if (hash[i] !=0) {
                    diff++;
                }
            }
            if (diff==0) {
                return true;
            }
            for (int i = s1.length(); i < s2.length(); i++) {
                int addc = s2.charAt(i) - 'a';
                int removec = s2.charAt(i - s1.length()) - 'a';
                if (addc == removec) {
                    continue;
                }
                int oldAddc = hash[addc];
                hash[addc]--;

                if (hash[addc] == 0) {
                    diff--;
                } else if (oldAddc == 0) {
                    diff++;
                }
                int oldRemovec = hash[removec];
                hash[removec]++;
                if (hash[removec] == 0) {
                    diff--;
                } else if (oldRemovec == 0) {
                    diff++;
                }

                if (diff == 0) {
                    return true;
                }
            }
            return false;
        }
    }
}
